import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Layout from './components/Layout';
import Home from './pages/Home';
import Dashboard from './pages/Dashboard';
import Analysis from './pages/Analysis';
import Jobs from './pages/Jobs';
import CreateJob from './pages/CreateJob';
import JobDetail from './pages/JobDetail';
import ResumeBank from './pages/ResumeBank';
import AddResume from './pages/AddResume';
import EditResume from './pages/EditResume';
import SearchCandidates from './pages/SearchCandidates';
import './App.css';

function App() {
  return (
    <Router>
      <Routes>
        {/* Home page without sidebar */}
        <Route path="/" element={
          <Layout showSidebar={false}>
            <Home />
          </Layout>
        } />

        {/* Dashboard pages with sidebar */}
        <Route path="/dashboard" element={
          <Layout showSidebar={true}>
            <Dashboard />
          </Layout>
        } />

        <Route path="/analysis/:id" element={
          <Layout showSidebar={true}>
            <Analysis />
          </Layout>
        } />

        <Route path="/jobs" element={
          <Layout showSidebar={true}>
            <Jobs />
          </Layout>
        } />

        <Route path="/jobs/create" element={
          <Layout showSidebar={true}>
            <CreateJob />
          </Layout>
        } />

        <Route path="/jobs/:id" element={
          <Layout showSidebar={true}>
            <JobDetail />
          </Layout>
        } />

        <Route path="/resume-bank" element={
          <Layout showSidebar={true}>
            <ResumeBank />
          </Layout>
        } />

        <Route path="/resume-bank/add" element={
          <Layout showSidebar={true}>
            <AddResume />
          </Layout>
        } />

        <Route path="/resume-bank/:id/edit" element={
          <Layout showSidebar={true}>
            <EditResume />
          </Layout>
        } />

        <Route path="/resume-bank/search-candidates/:jobId" element={
          <Layout showSidebar={true}>
            <SearchCandidates />
          </Layout>
        } />
      </Routes>
    </Router>
  );
}

export default App;
